"Shape of You" is a song by English singer-songwriter Ed Sheeran. It was released on 6 January 2017 as one of the double lead singles from his third studio album ÷ (2017), along with "Castle on the Hill". The Dance Hall & R&B infused song was written by Sheeran, Steve Mac and Johnny McDaid. Due to its interpolation of "No Scrubs" by TLC, Kandi Burruss, Tameka "Tiny" Cottle, and Kevin "She'kspere" Briggs are also credited as writers. The song was produced by Sheeran and Steve Mac.

